import React from "react";

function FifthSectionComponent() {
  return (
    <React.Fragment>
        <div className="program-fifth-section">
            <h2>Apply now!</h2>
            <p>Ready to take your passion for neuroscience to the next level? Apply now for the IYNA October Chapter Neuroscience Program! This six-week immersive summer program is designed for students and enthusiasts eager to explore the fundamentals of neuroscience, from brain structure and neural signaling to cognitive neuroscience and neuropathology. Join a vibrant community, gain hands-on experience, and receive mentorship to prepare for the Brain Blitz competition. Don’t miss this opportunity to deepen your understanding and connect with like-minded peers—secure your spot today through our Application Portal!</p>
            <a href="/">Application Portal  <i className="fa-solid fa-arrow-up-right-from-square"></i></a>
         </div>
    </React.Fragment>
  );
}

export default FifthSectionComponent;
